<script>

var i, tabcontent, tablinks;
tabcontent = document.getElementsByClassName("tabcontent");
for (i = 0; i < tabcontent.length; i++) {
	tabcontent[i].style.display = "none";
}

function openCity(evt, cityName) {
	var i, tabcontent, tablinks;
	tabcontent = document.getElementsByClassName("tabcontent");
	for (i = 0; i < tabcontent.length; i++) {
		tabcontent[i].style.display = "none";
	}
	tablinks = document.getElementsByClassName("tablinks");
	for (i = 0; i < tablinks.length; i++) {
		tablinks[i].className = tablinks[i].className.replace(" active", "");
	}
	document.getElementById(cityName).style.display = "block";
	evt.currentTarget.className += " active";
}

let mktu_result = document.querySelectorAll("[class='mktu_result']");
[].forEach.call(mktu_result, function(elem) {
	elem.addEventListener('click', function(e) {
		if(this.classList.contains("active")) {
			window.classificator.showModal();
			var tabcontent;
			document.getElementsByClassName("tablinks")[Number(elem.innerHTML)-1].click();
			console.log(elem.innerHTML);
		}
	}, false);
});

let elems = document.querySelectorAll("[class='noselect']");
[].forEach.call(elems, function(elem) {
	elem.addEventListener('click', function(e) {
		if(this.classList.contains("select")) {
			this.classList.remove("select");
			document.querySelector('.tablinks.active span').innerHTML = Number(document.querySelector('.tablinks.active span').innerHTML)-1;
		} else {
			this.classList.add("select");
			document.querySelector('.tablinks.active span').innerHTML = Number(document.querySelector('.tablinks.active span').innerHTML)+1;
		}
		if(Number(document.querySelector('.tablinks.active span').innerHTML) > 0 ){
			document.querySelector('.tablinks.active').classList.add("bold");
		} else {
			document.querySelector('.tablinks.active').classList.remove("bold");
		}
	}, false);
});

function select_all(event){
	let id_tab = event.closest(".tabcontent");
	let allspan = document.querySelector("[id='"+id_tab.id+"'][class='tabcontent']").querySelector("[class='class_mktu']").querySelectorAll(".noselect");
	let count_allspan = 0;
	[].forEach.call(allspan, function(elem) {
		if(elem.classList.contains("select")) {
			count_allspan = count_allspan + 1;
		}
	});
	if ((count_allspan>0) && (count_allspan<allspan.length)){
		[].forEach.call(allspan, function(elem) {
			if(elem.classList.contains("select")) {
				elem.classList.remove("select");
			}
		});
		document.querySelector('.tablinks.active span').innerHTML = 0;
	}
	let vo = 0;
	[].forEach.call(allspan, function(elem) {
		if(elem.classList.contains("select")) {
			elem.classList.remove("select");
			document.querySelector('.tablinks.active span').innerHTML = Number(document.querySelector('.tablinks.active span').innerHTML)-1;
		} else {
			vo++;
			elem.classList.add("select");
			document.querySelector('.tablinks.active span').innerHTML = Number(document.querySelector('.tablinks.active span').innerHTML)+1;
		}
		if(Number(document.querySelector('.tablinks.active span').innerHTML) > 0 ){
			document.querySelector('.tablinks.active').classList.add("bold");
		} else {
			document.querySelector('.tablinks.active').classList.remove("bold");
		}
	});
	if(vo>0){
		event.innerHTML = 'Снять выделение';
	} else {
		event.innerHTML = 'Выделить все';
	}
}

